# Parse the HTML content with BeautifulSoup
soup = BeautifulSoup(html, 'html.parser')
print(soup.prettify())
# Find all the rows containing player data
rows = soup.find_all(class_="eapl-player-ratings-data-table__tbody-row")
print(rows)

# Define a list to store the extracted data
player_data = []

# Iterate over each row
for row in rows:
    # Extracting rank
    rank = row.find(class_="eapl-player-ratings-data-table__ratings-value").get_text(strip=True)
    
    # Extracting name
    name = row.find(class_="eapl-player-ratings-data-table__player-name").get_text(strip=True)
    
    # Extracting position
    position = row.find(class_="eapl-player-ratings-data-table__player-position").get_text(strip=True)
    
    # Extracting pic URL
    pic = row.find(class_="eapl-player-ratings-data-table__player-shield-container").img['src']
    
    # Append the extracted data to the list
    player_data.append({
        "rank": rank,
        "name": name,
        "position": position,
        "pic": pic
    })

# savw the extracted data to a json file
with open('player_data.json', 'w') as outfile:
    json.dump(player_data, outfile, indent=4)